retrieveCurrentActivePrograms = async function() {
  var activePrograms, e, i, j, len, len1, program, programDataResult, promises, result, results;
  programdatahandlermodule_log("retrieveCurrentActivePrograms");
  programdatahandlermodule_state.programs = {
    relaxprograms: [],
    performprograms: []
  };
  try {
    result = (await databaseHandler.getCurrentActivePrograms());
    activePrograms = result.results;
    promises = [];
    for (i = 0, len = activePrograms.length; i < len; i++) {
      program = activePrograms[i];
      promises.push(databaseHandler.getDynamicProgramData(program.programs_dynamic_id));
    }
    results = [];
    results = (await Promise.all(promises));
    for (j = 0, len1 = results.length; j < len1; j++) {
      programDataResult = results[j];
      digestProgramData(programDataResult.results[0]);
    }
    return programdatahandlermodule_log("initially digested ProgramInfo!");
  } catch (error) {
    e = error;
    return console.log(e);
  }
};

